import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import FinalTop from './finalTop';
import {Link} from 'react-router-dom';
import './FinalNav.css';

class FinalNav extends Component{

    constructor(props) {
        super(props);
        this.state = {
            plant : 'Kothagadi',
        };
        this.OnPlantChange = this.OnPlantChange.bind(this);
    }

    static Hello(){
            document.getElementById('sidebar').classList.toggle('active');
    }

    render(){
        return (
            <div className="wrapper">
                    <button type="button" id="sidebarCollapse" className="btn btn-info fa-navicon" onClick={FinalNav.Hello}>
                        <div className='hellobro'>
                            <span className='bro'></span>
                            <span className='bro'></span>
                            <span className='bro'></span>
                        </div>
                        {/*<i className="fa fa-align-justify"></i> <span>toggle sidebar</span>*/}
                    </button>
                <nav id="sidebar">
                    <div className="sidebar-header">
                        <h3>QR App</h3>
                    </div>
                    <ul className="list-unstyled components">
                        <li className="active">
                            <label htmlFor="sel1">Select Plant:</label>
                            <select onChange={this.OnPlantChange} className="form-control" id="sel1">
                                <option selected>Kothagadi</option>
                                <option>Orai</option>
                                <option>Peerampalli</option>
                                <option>Parigi</option>
                                <option>Rohini</option>
                            </select>
                        </li>
                        <li>
                            {/*<a href="#">Row Stats</a>*/}
                            <Link to='/rowenquiry'>Row Stats</Link>
                        </li>
                        <li>
                            {/*<a href="#">Zone Stats</a>*/}
                            <Link to='/zonestats'>Zone Stats</Link>
                        </li>
                    </ul>

                    <ul className="list-unstyled CTAs">
                        <li>
                            <a href="#" className="download">Logged in as</a>
                        </li>
                        <li>
                            <a href="#" className="article">{this.props.name}</a>
                        </li>
                    </ul>
                </nav>
                <div id='hell'>
                    <nav className="navbar navbar-expand-lg navbar-dark" style = {{background : '#7386D5', color : '#fff'}}>
                        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav"
                                aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                            <span className="navbar-toggler-icon"></span>
                        </button>
                        <div className="collapse navbar-collapse" id="navbarNav">
                            <ul className="navbar-nav">
                                <li className="nav-item active">
                                    <a className="nav-link" href="#">{this.state.plant}< span className="sr-only">(current)</span></a>
                                </li>
                                <li className="nav-item active">
                                    <strong className="nav-link" href="#" dangerouslySetInnerHTML = {{ __html: this.props.pr.cycle }}></strong>
                                </li>
                                <li className="nav-item active">
                                    <strong className="nav-link" dangerouslySetInnerHTML = {{ __html: this.props.pr.select }}></strong>
                                </li>
                                <li className="nav-item active">
                                    <a className="nav-link" href="#" tabIndex="-1"
                                       aria-disabled="true"></a>
                                </li>
                            </ul>
                        </div>
                    </nav>
                </div>
            </div>
        );
    }

    OnPlantChange(event) {
        this.setState({
            plant : event.target.value,
        });
        // console.log(this.state);
        // console.log(this.props.items[0].props.value);
        // console.log(this.props.number);
        // let __html = this.props.pr.cycle;
        // console.log(__html);
        // let __html1 = this.props.pr.select;
        // console.log(__html1);
    }
}

export default FinalNav;
